import React from 'react'
import Button from "@material-ui/core/Button";
import ButtonGroup from "@material-ui/core/ButtonGroup";
import "./MyButton.css"

const MyButton = () => {
    return (
        <>
        <Button variant="contained" color="primary" disableElevation>
        Disable elevation
        </Button>
        </>
    )
}

export default MyButton
